import './App.css';

let text = "test variable";

function App() {
  let text2 = "222";
  return (
		<>
			<div className="container">
				<h1>app_1</h1>
				<img src="/images/logo512.png" alt="logo" />
				<ul>
					<li>Hello</li>
					<li>{ text + text }</li>
				</ul>
			</div>
		</>
  );
}

export default App;
